import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';

function SearchBar() {
	return (
		<ComponentWrapper>
			<div className="searchbar-container">
				<form role="presentation" action=".">
					<input
						type="search"
						placeholder="#태그, 회사, 포지션 검색"
						autoComplete="off"
					/>
					<svg
						xmlns="https://www.w3.org/2000/svg"
						width="18"
						height="18"
						viewBox="0 0 18 18"
						className="searchbar-searchicon"
					>
						<defs>
							<path
								id="qt2dnsql4a"
								d="M15.727 17.273a.563.563 0 10.796-.796l-4.875-4.875-.19-.165a.563.563 0 00-.764.028 5.063 5.063 0 111.261-2.068.562.562 0 101.073.338 6.188 6.188 0 10-1.943 2.894l4.642 4.644z"
							/>
						</defs>
						<g fill="none" fillRule="evenodd">
							<use
								fill="#333"
								fillRule="nonzero"
								stroke="#333"
								strokeWidth=".3"
								xlinkHref="#qt2dnsql4a"
							/>
						</g>
					</svg>
					<button type="button" className="searchbar-close-icon">
						<svg width="24" height="24" viewBox="0 0 24 24">
							<path
								fill="currentColor"
								d="M17.97 19.03a.75.75 0 001.06-1.06l-6.5-6.5a.75.75 0 00-1.06 0l-6.5 6.5a.75.75 0 001.06 1.06L12 13.06l5.97 5.97zM12 10.94L6.03 4.97a.75.75 0 00-1.06 1.06l6.5 6.5a.75.75 0 001.06 0l6.5-6.5a.75.75 0 00-1.06-1.06L12 10.94z"
							/>
						</svg>
					</button>
				</form>
				<div className="result-container">
					<div className="container" role="presentation">
						<h4 className="recentresult-container">
							추천태그로 검색해보세요
						</h4>
						<Link
							to="/tag_search"
							className="recentresult-rightsidebtn"
						>
							기업태그 홈 이동하기
							<svg width="12" height="12" viewBox="0 0 12 12">
								<path
									fill="currentColor"
									d="M4.22 9.72a.75.75 0 001.06 1.06l4.25-4.25a.75.75 0 000-1.06L5.28 1.22a.75.75 0 00-1.06 1.06L7.94 6 4.22 9.72z"
								/>
							</svg>
						</Link>
						<ul className="recentsearch-result-container">
							<li className="taglist-item">
								<button className="tag-container" type="button">
									#스타트업
								</button>
							</li>
							<li className="taglist-item">
								<button className="tag-container" type="button">
									#퇴사율5%이하
								</button>
							</li>
							<li className="taglist-item">
								<button className="tag-container" type="button">
									#산업기능요원
								</button>
							</li>
							<li className="taglist-item">
								<button className="tag-container" type="button">
									#연봉상위1%
								</button>
							</li>
							<li className="taglist-item">
								<button className="tag-container" type="button">
									#연봉상위2~5%
								</button>
							</li>
						</ul>

						<h4 className="RecentSearchResults_searchLabelClass__l5R6_">
							최근 검색 기록
						</h4>
						<button
							type="button"
							className="RecentSearchResults_rightSideButton__6OgA6"
							data-attribute-id="search__deleteHistory"
						>
							전체삭제
						</button>
						<ul className="RecentSearchResults_listClass__3KCcZ">
							<li className="keywordListItem">
								<a
									href="/search?query=%EC%95%88%EB%93%9C%EB%A1%9C%EC%9D%B4%EB%93%9C"
									className=""
									aria-label=""
								>
									안드로이드
								</a>
								<button
									type="button"
									className="RecentSearchResults_listClassBtn__jIt_x"
								>
									<svg
										width="24"
										height="24"
										viewBox="0 0 24 24"
									>
										<path
											fill="currentColor"
											d="M17.97 19.03a.75.75 0 001.06-1.06l-6.5-6.5a.75.75 0 00-1.06 0l-6.5 6.5a.75.75 0 001.06 1.06L12 13.06l5.97 5.97zM12 10.94L6.03 4.97a.75.75 0 00-1.06 1.06l6.5 6.5a.75.75 0 001.06 0l6.5-6.5a.75.75 0 00-1.06-1.06L12 10.94z"
										/>
									</svg>
								</button>
							</li>
							<li className="keywordListItem">
								<a
									href="/search?query=%ED%94%84%EB%A1%A0%ED%8A%B8%EC%97%94%EB%93%9C"
